import React from "react";
import {
	MenuContainer,
	MenuWrap,
	MenuItens,
	MenuTitulo,
} from "./MenuElementos";

const Menu = () => {
	return (
		<MenuContainer>
			<MenuWrap>
				<MenuItens>
					<MenuTitulo></MenuTitulo>
					<MenuLista>
						<MenuListaItem></MenuListaItem>
					</MenuLista>
				</MenuItens>
			</MenuWrap>
		</MenuContainer>
	);
};

export default Menu;
